import React from 'react'
import '../css/Toddo.css'


function ToddoList(props) {

  return (
    <div>
    <ul className="arrange-list">

    {props.data.map(e => 
      <li className="arrange-order" key={e.id} id={e.id}>
        {e.text}

      </li>
    )}
    </ul>
</div>

  )
}

export default ToddoList
